pragma solidity ^0.5.0;
contract test {
   struct Book {
      string title;
      string author;
      uint book_id;
   }
   Book book;
   function setBook() public {
      book = Book('Learn Java', 'TP', 1);
   }
   function getBookId() public view returns (string memory) {
      return book.title;
   }
}
